import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
class Body extends Component {
    render() {
        return (
            <div className="calculator">
                <Container>
                    <Row>
                        <Col lg={6}>
                            <Row>
                                <Col lg={8}>
                                    <h5 className="billTitle">Bill</h5>
                                </Col>
                                <Col lg={8}></Col>
                            </Row>
                        </Col>
                </Row>
                </Container>
            </div>
        )
    }
}
export default Body;
